import axios from "axios";

const sendUserData = async (method, body) => {
    const data = {
            "jsonrpc": "2.0",
            "id": 0,
            "method": method,
            "params": {
                body
            }
        };
    console.log(data)
    return await axios.post(
        'https://videohosting.onrender.com/api/v1/user',
        data
    );
};

const sendVideoData = async (method, params) => {
    return await axios.post(
        ' http://127.0.0.1:8000/api/v1/video',
        {
            "jsonrpc": "2.0",
            "id": 0,
            "method": method,
            "params": {
                params
            }
        }
    );
};

const sendAdminData = async (method, params) => {
    return await axios.post(
        ' http://127.0.0.1:8000/api/v1/admin',
        {
            "jsonrpc": "2.0",
            "id": 0,
            "method": method,
            "params": {
                params
            }
        }
    );
};

const UploadVideo = async (title, description, video_file, preview_file) => {
    const formData = new FormData();
    formData.append('title', title);
    formData.append('description', description);
    formData.append('video_file', video_file);
    formData.append('preview_file', preview_file)

    return await axios.post(' http://127.0.0.1:8000/upload_video',
        formData);
}


export default sendUserData;
